schools:
{"query":"
query GetSchoolData($propertyId: ID!) {
  home(property_id: $propertyId) {
    schools(query: { include_suppressed_schools: true, limit_per_level: 3 }) {
      total
      schools {
        id
        name
        slug_id
        slug
        education_levels
        distance_in_miles
        student_teacher_ratio
        rating
        grades
        funding_type
        student_count
        review_count
        parent_rating
        assigned
      }
    }
  }
}","propertyId":"9969558748","callfrom":"LDP","nrQueryType":"NEARBY_SCHOOLS","variables":{"propertyId":"9969558748"},"isClient":true}

